{
    if (_parent["方向"] == "右")
    {
        if (Key.isDown(_root["右键"]) == true)
        {
            _parent[移动]("右", 快速度);
        }
        else
        {
            _parent[移动]("右", 慢速度);
        } // end else if
    }
